    "#=================================================\n",
    "# EXPORT SUMMARY FILE\n",
    "#=================================================\n",
    "# Create a csv file for further analysis and visualization\n",
    "counts <- aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual + all_trips_v2$day_of_week, FUN = mean)\n",
    "write.csv(counts, \"/kaggle/working/avg_ride_length.csv\", row.names = F) # save to notebook output"
   ]
